INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CME', 'STOCK', 'CME Group Inc.', 'NMS', 'Financial Services', 'Financial Data & Stock Exchanges', 'CME Group Inc. Fornece um mercado de derivativos. A Empresa permite que os clientes negociem futuros, opções, caixa e mercados de balcão (OTC), otimizem portfólios e analisem dados. As bolsas de TI oferecem uma gama de produtos de referência global em todas as principais classes de ativos com base em taxas de juros, índices de ações, câmbio (FX), energia, produtos agrícolas e metais. Ele oferece futuros e opções de negociação de futuros através da plataforma CME Globex, negociação de renda fixa via BrokerTec e negociação FX na plataforma EBS. Além disso, opera o provedor central de compensação de contrapartes, CME Clearing. Seus produtos fornecem um meio de cobertura, especulação e alocação de ativos relacionados aos riscos associados, entre outras coisas, a instrumentos sensíveis à taxa de juros e mudanças nos preços das commodities agrícolas, energéticas e metálicas. Fornece serviços de compensação e liquidação para uma gama de futuros e opções negociados em bolsa em contratos futuro', 'Chicago, IL, United States', 3760);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COST', 'STOCK', 'Costco Wholesale Corporation', 'NMS', 'Consumer Defensive', 'Discount Stores', 'A Costco Wholesale Corporation (Costco) opera armazéns de associados e sites de comércio eletrônico que oferecem uma seleção de produtos de marca nacional e marca própria em uma ampla gama de categorias. A Companhia compra a maioria de sua mercadoria diretamente de fornecedores e a encaminha para pontos de consolidação cross-docking (depósitos) ou diretamente para seus armazéns. Ele opera 891 armazéns, incluindo 614 nos Estados Unidos e Porto Rico, 108 no Canadá, 40 no México, 35 no Japão, 29 no Reino Unido, 19 na Coreia, 15 na Austrália, 14 em Taiwan, sete na China, cinco na Espanha, dois na França e um na Islândia, Nova Zelândia e Suécia. Ele também opera sites de comércio eletrônico nos Estados Unidos, Canadá, Reino Unido, México, Coreia e outros países. Taiwan, Japão e Austrália. A Empresa oferece ampla seleção de mercadorias, além da conveniência de departamentos especializados e serviços exclusivos para membros.', 'Issaquah, WA, United States', 333000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AZI', 'STOCK', 'Autozi Internet Technology (Global) Ltd.', 'NGM', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Autozi Internet Technology Global Ltd is a company that is primarily engaged in providing automotive lifecycle services. The Company operates three divisions. New Car Sales segment includes parallel imported car sales and new energy vehicle sales. Auto Parts and Auto Accessories Sales segment mainly conducts business to auto parts dealers and gradually upgrades to direct connection with local MBS stores. The segment sells multiple product brands as well as its own brands, covering lubricating oil, battery, filter, brake pad, antifreeze, wiper blade, and chemicals. Automotive Insurance Related Services segment includes value-added repair services, claims and repair services, and insurance intermediary services.', 'Beijing, , China', 86);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DHAI', 'STOCK', 'DIH Holding US, Inc.', 'NGM', 'Healthcare', 'Medical Devices', 'DIH Holding US, Inc. is a global provider of advanced robotic devices used in physical rehabilitation. Its rehabilitation hospitals and outpatient clinics offering solutions include ArmeoPower, ArmeoSpring, ArmeoSpring Pro, ArmeoSenso, Erigo, Lokomat, SafeGait 360 by Gorbel, RYSEN, Andago, C-Mill, and HocoNet. Its Research & Academia offering solutions include GRAIL, CAREN Extended, CAREN High-End, M-Gait, and D-Flow. The ArmeoSpring Pro is a cutting-edge medical device designed to bring upper limb rehabilitation to the next level. Its new arm weight support, powered by TrueG technology, allows patients to receive continuous arm weight support from shoulder extension to shoulder flexion. ArmeoPower guides the initial phases of arm and hand function recovery. ArmeoSpring supports the recovery of arm and hand functions. ArmeoSenso is a sensor-based solution for arm function recovery. HocoNet is a software platform connecting product portfolio across the entire continuum of care.', 'Norwell, MA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AGI', 'STOCK', 'Alamos Gold Inc.', 'NYQ', 'Basic Materials', 'Gold', 'Alamos Gold Inc. is a Canadian intermediate gold producer with diversified production from three operating mines in North America. This includes the Island Gold District and the Young-Davidson mine in northern Ontario, Canada, and the Mulatos District in Sonora State, Mexico. Additionally, it has a portfolio of development stage projects, including the Phase 3+ Expansion at Island Gold, and the Lynn Lake project in Manitoba, Canada. The Island Gold Mine is located about 83 kilometers (km) northeast of Wawa, in northern Ontario. The Young-Davidson Mine is located in northern Ontario, Canada, centrally located between Timmins, Kirkland Lake, North Bay, and Sudbury. The Mulatos Mine is located 220 km east of Hermosillo in the state of Sonora in northwest Mexico. The Lynn Lake project is located in northern Manitoba and consists of two primary sites, MacLellan and Gordon. Its other projects are the Turkish Development Projects, the Quartz Mountain Gold Project, and Qiqavik Gold Project.', 'Toronto, ON, Canada', 2400);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BRKR', 'STOCK', 'Bruker Corporation', 'NMS', 'Healthcare', 'Medical Devices', 'A Bruker Corporation é desenvolvedora, fabricante e distribuidora de instrumentos científicos e soluções analíticas e de diagnóstico. Seu segmento BSI BioSpin projeta, fabrica e distribui ferramentas de ciências da vida habilitantes baseadas em tecnologia de ressonância magnética. Seu segmento BSI CALID projeta, fabrica e distribui soluções de espetrometria de massa em ciências da vida e espetrometria de mobilidade iônica, instrumentos e soluções de análise de processos e análises analíticas. Seu segmento BSI Nano projeta, fabrica e distribui instrumentos avançados de raios X, instrumentação de microscopia de força atômica, instrumentos avançados de microscopia ótica de fluorescência. Seu segmento Bruker Energy & Supercon Technologies (BEST) desenvolve e fabrica materiais e dispositivos supercondutores e não supercondutores para uso em energia renovável, infraestrutura de energia, saúde e grande pesquisa científica. Suas linhas de produtos incluem NCounter, CosMx, GeoMx e AtoMx. Também', 'Billerica, MA, United States', 11396);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BXP', 'STOCK', 'BXP, Inc.', 'NYQ', 'Real Estate', 'REIT - Office', 'A BXP, Inc. É uma confiança de investimento imobiliário totalmente integrada, auto-administrada e auto-gerida. A empresa desenvolve, possui e gerencia locais de trabalho de primeira linha nos Estados Unidos. Os segmentos da empresa por área geográfica são Boston, Los Angeles, Nova York, São Francisco, Seattle, seu segmento por tipo de propriedade inclui escritório (que inclui escritório, ciências da vida e varejo), residencial e hotel. Seu portfólio totaliza 53,0 milhões de pés quadrados e 184 propriedades, incluindo nove propriedades em construção/redesenvolvimento. Suas propriedades consistem em 162 propriedades de escritório e ciências da vida (incluindo sete propriedades em construção / redesenvolvimento); 14 propriedades de varejo (incluindo uma propriedade em construção); sete propriedades residenciais (incluindo duas propriedades em construção) e um hotel. Suas propriedades incluem Times Square Tower, 100 Federal Street, 767 Fifth Avenue, 601 Lexington Avenue, Atlantic Wharf Off', 'Boston, MA, United States', 816);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADMA', 'STOCK', 'ADMA Biologics, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'ADMA Biologics, Inc. is an end-to-end commercial biopharmaceutical company dedicated to manufacturing, marketing and developing specialty biologics for the treatment of immunodeficient patients at risk for infection and others at risk for certain infectious diseases. The Company manufactures and markets three United States Food and Drug Administration (FDA)-approved plasma-derived biologics for the treatment of immune deficiencies and the prevention of certain infectious diseases: ASCENIV (immune globulin intravenous, human-slra 10% liquid) for the treatment of primary humoral immunodeficiency (PI); BIVIGAM (immune globulin intravenous, human) for the treatment of PI; and NABI-HB (hepatitis B immune globulin, human) to provide enhanced immunity against the hepatitis B virus. Through its ADMA BioCenters subsidiary, the Company also operates as an FDA-approved source plasma collector in the United States, which provides its blood plasma for the manufacture of its products.', 'Ramsey, NJ, United States', 685);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BROS', 'STOCK', 'Dutch Bros Inc.', 'NYQ', 'Consumer Cyclical', 'Restaurants', 'Dutch Bros Inc. is an operator and franchiser of drive-thru shops, which is focused on serving hand-crafted beverages. The Company sells a range of customizable hot, iced and blended beverages. Coffee-based beverages include its espresso-based custom drinks, cold brew and its proprietary Freeze blended beverages. Its Private Reserve coffee is a 100% Arabica three-bean blend, roasted in its Grants Pass facility. Its proprietary Blue Rebel energy drink is customizable with flavors and modifiers. It also offers a variety of teas, lemonades, sodas and smoothies. The Company has two segments: Company-operated shops, and Franchising and other. The Company-operated shops segment includes coffee shop sales to customers. The Franchising and other segment includes bean and product sales to franchise partners and includes the initial franchise fees, royalties, and marketing fees. It has approximately 982 shops, of which 670 are operated by the Company and 312 are franchised, across 18 states.', 'Grants Pass, OR, United States', 20000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUD', 'STOCK', 'Anheuser-Busch InBev SA/NV', 'NYQ', 'Consumer Defensive', 'Beverages - Brewers', 'A Anheuser-Busch Inbev SA é uma empresa sediada na Bélgica. A empresa está envolvida principalmente na fabricação de cerveja. A empresa opera através de seis segmentos: América do Norte, Oriente Médio, América do Sul, EMEA, Ásia-Pacífico, empresas globais de exportação e holding. O portfólio de marcas da Companhia inclui marcas globais, como Budweiser, Corona e Stella Artois; marcas internacionais, incluindo Beck''s, Leffe e Hoegaarden, e campeões locais, como Bud Light, Skol, Brahma, Antártica, Quilmes, Victoria, Modelo Especial, Michelob Ultra, Harbin, Sedrin, Klinskoye, Sibirskaya Korona, Chernigivske, Cass e Jupiler. O negócio de refrigerantes da Companhia consiste em produção própria e acordos com a PepsiCo relacionados a arranjos de engarrafamento e distribuição entre suas diversas subsidiárias e a PepsiCo. A AmBev, que é uma subsidiária da Companhia, é um engarrafador da PepsiCo. As marcas que são distribuídas ao abrigo destes acordos são Pepsi, 7UP e Gatorade.', 'Leuven, , Belgium', 144000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OPK', 'STOCK', 'OPKO Health, Inc.', 'NMS', 'Healthcare', 'Diagnostics & Research', 'OPKO Health, Inc. is a multinational biopharmaceutical and diagnostics company. The Companys segments include pharmaceutical and diagnostics. The pharmaceutical segment consists of the pharmaceutical operations it operates in Chile, Mexico, Ireland, Israel, Spain, Ecuador, France, the United States, and its global pharmaceutical research and development operations. The diagnostics segment primarily consists of clinical laboratory operations through BioReference and its point-of-care operations. Its pharmaceutical business features Somatrogon (hGH-CTP), a once-weekly human growth hormone injection, and it is marketed under the brand name NGENLA. The Company, through its pharmaceutical division, manufactures and sells Rayaldee, a United States Food and Drug Administration (FDA) approved treatment for secondary hyperparathyroidism (SHPT) in adults with stage 3 or 4 chronic kidney disease (CKD) and vitamin D insufficiency.', 'Miami, FL, United States', 2997);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AMTM', 'STOCK', 'Amentum Holdings, Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'Amentum Holdings, Inc. is a global advanced engineering and technology solutions provider to a broad base of the United States and allied government agencies, supporting programs of critical national importance across energy and environmental, intelligence, space, defense, civilian and commercial end-markets. It offers a range of capabilities, including intelligence and counter-threat solutions, data fusion and analytics, engineering and integration, environmental solutions, advanced test, training and readiness, and citizen solutions. Its segments include Digital Solutions (DS) and Global Engineering Solutions (GES). The DS segment offers advanced digital and data-driven solutions including intelligence analytics, space system development, cybersecurity, and next-generation information technology for the federal government and commercial clients. The GES segment offers large-scale environmental remediation, clean energy, platform engineering, sustainment and supply chain management.', 'Chantilly, VA, United States', 53000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BW', 'STOCK', 'Babcock & Wilcox Enterprises, Inc.', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Babcock & Wilcox Enterprises, Inc. is a provider of renewable, environmental and thermal technologies for industrial, electrical utility, municipal and other customers. The Company operates through three segments: Babcock & Wilcox Renewable, Babcock & Wilcox Environmental, and Babcock & Wilcox Thermal. Its Babcock & Wilcox Renewable segment offers technologies for environmentally sustainable power and heat generation, including waste-to-energy, oxygen-fired biomass-to-energy and black liquor systems for the pulp and paper industry. Its Babcock & Wilcox Environmental segment provides emissions control and environmental technology solutions for utility, waste-to-energy, biomass-to-energy, carbon black, and industrial steam generation applications around the world. Its Babcock & Wilcox Thermal segment provides steam generation equipment, aftermarket parts, construction, maintenance and field services for plants in the power generation, oil and gas, and industrial sectors.', 'Akron, OH, United States', 1900);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DNA', 'STOCK', 'Ginkgo Bioworks Holdings, Inc.', 'NYQ', 'Healthcare', 'Biotechnology', 'Ginkgo Bioworks Holdings, Inc. operates as a horizontal platform for cell programming, providing end-to-end services for organizations across diverse markets, from food and agriculture to pharmaceuticals to industrial and specialty chemicals. Its segments include Cell Engineering and Biosecurity. The Cell Engineering consists of research and development services performed under collaboration and license agreements relating to its cell programming platform. Its cell programming platform includes two core assets: the Foundry, and Codebase. The Biosecurity segment consists of biomonitoring and bioinformatics support services, offered to both government and non-government customers through its two core offerings: Canopy and Horizon. The Company provides comprehensive research and development services spanning the genetic medicine modalities: gene therapy, cell therapy and gene editing, and RNA therapeutics.', 'Boston, MA, United States', 834);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('APLE', 'STOCK', 'Apple Hospitality REIT, Inc.', 'NYQ', 'Real Estate', 'REIT - Hotel & Motel', 'Apple Hospitality REIT, Inc. is a real estate investment trust (REIT) that owns a diverse portfolio of upscale, room-focused hotels in the United States. The Company''s portfolio consists of about 221 hotels with more than 29,893 guest rooms located in 85 markets throughout 37 states as well as one property leased to third parties. Its hotel portfolio consists of 97 Marriott-branded hotels, 118 Hilton-branded hotels, five Hyatt-branded hotels, and one independent hotel. Its hotels operate under Marriott or Hilton brands. The hotels are operated and managed under separate management agreements with 16 hotel management companies, consisting of Hilton Garden Inn, Hampton, Courtyard, Residence Inn, Homewood Suites, SpringHill Suites, Fairfield, Home2 Suites, TownePlace Suites, AC Hotels, Hyatt Place, Aloft, and others. Its hotels are located in various states, including Alaska, Arizona, California, Colorado, Florida, Georgia, Idaho, Illinois, Kansas, Louisiana, Michigan, and others.', 'Richmond, VA, United States', 65);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DGXX', 'STOCK', 'Digi Power X Inc.', 'NCM', 'Utilities', 'Utilities - Independent Power Producers', 'Digi Power X Inc. is a vertically integrated artificial intelligence (AI) and energy infrastructure company. The Company designs and deploys modular tier three data centers through its AI-Ready Modular Solution (ARMS) platform and offers enterprise-grade GPU compute through its NeoCloud portal, leveraging advanced NVIDIA GPU technology and secured energy infrastructure. Through its subsidiary, US Data Centers, Inc. (US Data Centers), it is focused on creating a platform dedicated entirely to delivering artificial intelligence (AI) and HPC solutions, ensuring purpose-built infrastructure for computing. Its segments include cryptocurrency mining, sales of energy and electricity and colocation services. With multiple sites, including its combined cycle and high-capacity substations, the Company enhances the energy grid, supporting both industrial clients and broader energy markets. It operates Bitcoin mining sites and focuses on procuring power from renewable energy sources.', 'Miami, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('COSM', 'STOCK', 'Cosmos Health Inc.', 'NCM', 'Healthcare', 'Medical Distribution', 'Cosmos Health Inc. is a diversified, vertically integrated global healthcare company. The Company owns a portfolio of proprietary pharmaceutical and nutraceutical brands, including Sky Premium Life, Mediterranation, bio-bebe, C-Sept and C-Scrub. Through its subsidiary Cana Laboratories S.A., it manufactures pharmaceuticals, food supplements, cosmetics, biocides, and medical devices within the European Union. It also distributes a broad line of pharmaceuticals and parapharmaceuticals, including branded generics and over-the-counter (OTC) medications, to retail pharmacies and wholesale distributors through its subsidiaries in Greece and the United Kingdom. It also has research and development (R&D) partnerships targeting health disorders such as obesity, diabetes, and cancer, enhanced by artificial intelligence drug repurposing technologies, and focuses on the R&D of patented nutraceuticals, specialized root extracts, proprietary complex generics, and OTC products.', 'Chicago, IL, United States', 149);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWAN', 'STOCK', 'Clearwater Analytics Holdings, Inc.', 'NYQ', 'Technology', 'Software - Application', 'Clearwater Analytics Holdings, Inc. is a provider of comprehensive cloud-native platforms for institutional investors across global public and private markets. The Companys single-instance, multi-tenant architecture delivers real-time data and artificial intelligence (AI)-driven insights throughout the investment lifecycle. The platform eliminates information silos by integrating portfolio management, trading, investment accounting, reconciliation, regulatory reporting, performance, compliance, and risk analytics in one unified system. The Company serves insurers, asset managers, hedge funds, banks, corporations, and governments. The Company is also a provider of enterprise risk analytics and developer infrastructure. Its capabilities in complex portfolio management across both public and private markets include structured products, private credit, and derivatives.', 'Boise, ID, United States', 1915);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BKSY', 'STOCK', 'BlackSky Technology Inc.', 'NYQ', 'Industrials', 'Specialty Business Services', 'BlackSky Technology Inc. is a space-based intelligence company. The Company delivers on-demand, high frequency imagery, monitoring and analytics of the strategic locations, economic assets, and events in the world. It designs, owns, and operates low earth orbit small satellite constellations. Its BlackSky Spectra platform processes data from its constellation and from other third-party sensors to develop the critical insights and analytics that its customers require. Its Spectra is a first-of-its-kind commercial platform that helps customers manage their monitoring activities from space. Spectra software platform processes millions of observations a day from both its proprietary satellite constellations and by using data from multiple external sources, including imaging, radar and radio frequency satellites, environmental sensors, asset tracking sensors, Internet of Thing connected devices, internet-enabled narrative sources, and a variety of geotemporal data feeds.', 'Herndon, VA, United States', 340);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CI', 'STOCK', 'The Cigna Group', 'NYQ', 'Healthcare', 'Healthcare Plans', 'O Cigna Group é uma empresa global de saúde. A empresa tem duas plataformas de crescimento: Evernorth Health Services e Cigna Healthcare. A Evernorth Health Services inclui seus segmentos de operação de Serviços de Benefício de Farmácia e Serviços de Especialidade e Cuidados, que fornecem soluções e capacidades de saúde independentes e coordenadas para permitir que o sistema de saúde funcione melhor e ajude as pessoas a viver vidas mais ricas e saudáveis. A Cigna Healthcare inclui os segmentos operacionais de saúde e saúde internacional dos EUA, que fornecem serviços abrangentes de plano médico e soluções coordenadas para clientes e clientes. Suas outras operações incluem seguro de vida de propriedade corporativa (coli), operações de run-off da empresa e outros negócios não estratégicos. A Specialty and Care Services fornece medicamentos especiais para o tratamento de doenças complexas e raras, distribuição de especialidades farmacêuticas e suprimentos médicos e programas clínicos para', 'Bloomfield, CT, United States', 71295);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('PAYO', 'STOCK', 'Payoneer Global Inc.', 'NGM', 'Technology', 'Software - Infrastructure', 'Payoneer Global Inc. is a financial technology company that helps small and medium-sized businesses (SMBs) to transact, do business, and grow globally. The Company''s financial stack provides a suite of cross-border accounts receivable (AR) and accounts payable (AP) capabilities, including multicurrency account capabilities, and includes services such as working capital and funds management. Its customers include goods exporters selling cross-border to consumers and other businesses, services companies exporting their capabilities to international clients, independent professionals, creators, contractors, and business owners capitalizing on the digitization of the workplace and remote work, vacation rental hosts, and others. Its customers sell their goods or services either via a marketplace or directly to other businesses (B2B), and/or to customers via webstores. The Company serves SMBs located in more than 190 countries and territories and operating in a variety of industries.', 'New York, NY, United States', 2407);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCIR', 'STOCK', 'Cohen Circle Acquisition Corp. I', 'NGM', 'Financial Services', 'Shell Companies', 'Cohen Circle Acquisition Corp. I is a blank check company. The Company is formed for the purpose of effecting a merger, share exchange, asset acquisition, share purchase, reorganization or other similar business combination, involving one or more businesses or assets. It intends to concentrate its efforts on identifying companies in the financial services technology (fintech) sector and fintech adjacent sectors that power transformation and innovation. The Company neither engaged in any operations nor generated any revenue.', 'Philadelphia, PA, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ATCH', 'STOCK', 'AtlasClear Holdings, Inc.', 'ASE', 'Technology', 'Software - Infrastructure', 'AtlasClear Holdings, Inc. is a technology-enabled financial services company. The Company offers a business-to-business platform for trading, clearing, settlement and banking of financial products with a focus on small and middle market financial services firms. It focuses on building a fully vertically integrated suite of cloud-based products, including account opening, trade execution, risk management, regulatory reporting, and settlement. It intends to offer clients the flexibility to choose from a variety of pre-built suites that serve a range of business models. It intends to target the client base for its banking and brokerage services, including financial services firms, including brokerage firms, hedge funds, pension plans, and family offices that are not adequately served by other correspondent clearing firms and banks. The Company is also engaged in providing full-service correspondent securities broker-dealer services through Wilson-Davis & Co., Inc. (Wilson-Davis).', 'Tampa, FL, United States', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CTVA', 'STOCK', 'Corteva, Inc.', 'NYQ', 'Basic Materials', 'Agricultural Inputs', 'Corteva, Inc. É uma empresa global de agricultura pura. É um fornecedor global de soluções de proteção de sementes e culturas focadas na indústria agrícola e contribuindo para um fornecimento de alimentos mais saudável, seguro e sustentável. O segmento de sementes está empenhado no desenvolvimento e fornecimento de sementes comerciais combinando germoplasma avançado e traços que produzem um rendimento ideal para fazendas em todo o mundo. Atua em vários mercados chave de sementes, incluindo milho e soja norte-americanos, milho europeu e girassol, bem como milho Brasil, India, África do Sul e Argentina. O segmento de Proteção de Culturas atende à indústria global de insumos agrícolas com produtos que protegem contra ervas daninhas, insetos e outras pragas, e doenças, e que apoiam a saúde geral das culturas tanto acima quanto abaixo do solo, por meio de gerenciamento de nitrogênio e tecnologias aplicadas por sementes. Suas soluções de proteção de culturas e soluções digitais fornecem aos ', 'Indianapolis, IN, United States', 22000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ARMK', 'STOCK', 'Aramark', 'NYQ', 'Industrials', 'Specialty Business Services', 'Aramark is a global provider of food and facilities services to education, healthcare, business and industry and sports, leisure, and corrections clients. The Company operates through two segments: Food and Support Services United States (FSS United States) and Food and Support Services International (FSS International). The FSS United States segment consists of five sectors, which include business and industry, education, healthcare, sports, leisure and corrections, and facilities and others. Its FSS International segment provides a similar range of services as those provided to its FSS United States segment clients and operates in each of the sectors. The Company provides food and beverage services, including catering and retail services, and facilities services, including plant operations and maintenance, custodial, housekeeping, landscaping and other services. The Company''s core market is the United States, which is supplemented by an additional 15-country footprint.', 'Philadelphia, PA, United States', 266680);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('FBIN', 'STOCK', 'Fortune Brands Innovations, Inc.', 'NYQ', 'Industrials', 'Building Products & Equipment', 'Fortune Brands Innovations, Inc. É uma empresa de produtos de construção residencial, de segurança e comercial. Seu segmento de inovações em água fabrica ou monta e vende torneiras, acessórios, pias de cozinha e descarte de resíduos, predominantemente sob as marcas Moen, ROHL, Riobel, Victoria Albert, Aqualisa e Shaws. A Outdoors Segment fabrica e vende sistemas de portas de entrada de fibra de vidro e aço, portas de tempestade, tela e segurança, decks compostos, trilhos e revestimentos sob a marca Fiberon, moinho de uretano sob a marca Fiberon, e sistemas de portas exteriores de abertura ampla e armários ao ar livre sob a marca Solar Innovations. O segmento de segurança inclui fechaduras, dispositivos de segurança e segurança, e produtos de segurança eletrônica sob as marcas Master Lock e Yale, e cofres resistentes ao fogo, recipientes de segurança sob a marca SentrySafe. A empresa, através da SpringWell Water Filtration Systems, fornece soluções residenciais de filtragem de água e am', 'Deerfield, IL, United States', 11000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADP', 'STOCK', 'Automatic Data Processing, Inc.', 'NMS', 'Technology', 'Software - Application', 'Automatic Data Processing, Inc. (ADP) é uma empresa global de tecnologia envolvida no fornecimento de soluções de gestão de capital humano (HCM) baseadas na nuvem que unem RH, folha de pagamento, talento, tempo, impostos e administração de benefícios. Seus segmentos incluem Serviços de Empregador e Organização Profissional de Empregadores (PEO). Seu segmento de Serviços de Empregador atende clientes que vão desde pequenas empresas de funcionários individuais a grandes empresas com dezenas de milhares de funcionários em todo o mundo, oferecendo uma gama de soluções HCM baseadas em tecnologia, incluindo suas plataformas baseadas em nuvem e soluções de terceirização de recursos humanos (HRO) (além de PEO). Suas ofertas incluem Payroll Services, Administração de Benefícios, Gestão de Talentos, Gestão de RH, Gestão de Força de Trabalho, serviços de Compliance, Serviços de Seguros e Serviços de Aposentadoria. Seu negócio PEO, chamado ADP TotalSource, fornece aos clientes soluções de terceiri', 'Roseland, NJ, United States', 67000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ETN', 'STOCK', 'Eaton Corporation plc', 'NYQ', 'Industrials', 'Specialty Industrial Machinery', 'Eaton Corporation plc é uma empresa inteligente de gestão de energia. Seu segmento de Electrical Americas consiste em componentes elétricos, componentes industriais, distribuição e montagem de energia, produtos residenciais, qualidade e conetividade de energia monofásica, dispositivos de fiação e outros. O segmento Electrical Global consiste em componentes elétricos, componentes industriais, distribuição e montagem de energia, qualidade de energia monofásica e trifásica e serviços. O segmento Aeroespacial é um fornecedor global de combustível aeroespacial, hidráulica e sistemas pneumáticos para uso comercial e militar e sistemas de filtração para aplicações industriais. O segmento de veículos projeta, fabrica, comercializa e fornece sistemas de transmissão e componentes críticos. O segmento eMobility projeta, fabrica, comercializa e fornece equipamentos mecânicos, elétricos, e componentes eletrônicos e sistemas. A empresa também está envolvida no fornecimento de monitoramento térmico p', 'Dublin, , Ireland', 94443);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AAPD', 'STOCK', 'Direxion Daily AAPL Bear 1X Shares', 'NGM', NULL, NULL, 'The fund, under normal circumstances, invests at least 80% of the fund’s net assets (plus borrowings for investment purposes) in financial instruments, including swap agreements and options, that, in combination, provide 1X daily inverse (opposite) or short exposure to AAPL, consistent with the fund’s investment objective. It is non-diversified.', '', NULL);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CG', 'STOCK', 'The Carlyle Group Inc.', 'NMS', 'Financial Services', 'Asset Management', 'The Carlyle Group Inc. is a global investment company. The Company operates through three segments: Global Private Equity, Global Credit, and Global Investment Solutions. Global Private Equity segment advises the Companys buyout, middle market and growth capital funds, its U.S. and internationally focused real estate funds, and its infrastructure and natural resources funds. This segment also includes the NGP Carry Funds advised by NGP. Global Credit segment advises funds and vehicles that pursue investment strategies, including segment advises funds and vehicles that pursue investment strategies, including insurance solutions, liquid credit, opportunistic credit, direct lending, asset-backed finance, aviation finance, infrastructure credit, cross-platform credit products, and global capital markets. The Global Investment Solutions segment advises on global private equity programs and related co-investment and secondary activities. It also focuses on private student loan portfolios.', 'Washington, DC, United States', 2300);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CURB', 'STOCK', 'Curbline Properties Corp.', 'NYQ', 'Real Estate', 'REIT - Retail', 'Curbline Properties Corp. is an owner and manager of convenience shopping centers positioned on the curbline of intersections and vehicular corridors in suburban, high household income communities. The Company''s properties are located in the United States and are geographically diversified, principally across the Southeast, Mid-Atlantic, Southwest and Mountain regions, along with Texas. It is focused on leasing space to a diversified group of primarily national, high credit quality tenants operating across a range of primarily service and restaurant businesses, including quick-service restaurants, healthcare and wellness, financial services, beverage retail, telecommunications, beauty and hair salons, and fitness, among others. Its properties include Promenade Plaza, Hampton Cove Corner, Eastchase Point, Shops at Tiger Town, Chandler Center, Shops at Gilbert Crossroads, Red Mountain Corner, Crossroads Marketplace, Shops on Montview, Estero Crossing, and Shops at Carillon.', 'New York, NY, United States', 37);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AON', 'STOCK', 'Aon plc', 'NYQ', 'Financial Services', 'Insurance Brokers', 'Aon PLC é uma empresa global de serviços profissionais. A Empresa presta assessoria e soluções a clientes focados em risco, saúde e riqueza através de quatro principais produtos e serviços: Soluções de risco comercial, soluções de resseguro, soluções de saúde e soluções de riqueza. A Commercial Risk Solutions inclui corretagem de varejo, soluções especializadas, consultoria de risco global e gestão de cativos e programas de afinidade. As soluções de resseguro incluem resseguro tratado, resseguro facultativo e mercados de capitais. A Health Solutions inclui consultoria e corretagem, benefícios voluntários e soluções de inscrição e soluções de capital humano. A Wealth Solutions inclui consultoria de aposentadoria, administração de pensões e consultoria de investimentos. Os serviços de análise e dados incluem Affinity, Aon Inpoint, CoverWallet e revisão. A consultoria de aposentadoria é especializada em fornecer aos clientes consultoria de design estratégico em seus programas de aposentad', 'Dublin, , Ireland', 60000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('RCKT', 'STOCK', 'Rocket Pharmaceuticals, Inc.', 'NGM', 'Healthcare', 'Biotechnology', 'Rocket Pharmaceuticals, Inc. is a fully integrated, late-stage biotechnology company focused on the development of gene therapies for rare and devastating diseases. The Company has two clinical stage and one pre-clinical stage in vivo adeno-associated viral (AAV) programs in the United States, which include programs for Danon disease (DD), a multi-organ lysosomal-associated disorder leading to early death due to heart failure; Plakophilin-2 Arrhythmogenic Cardiomyopathy (PKP2-ACM), an inheritable cardiac disorder that is characterized by a progressive loss of cardiac muscle mass, severe right ventricular dilation, dysplasia, fibrofatty replacement of the myocardium and a high propensity to arrhythmias and sudden death (RP-A601), and BAG3 Dilated Cardiomyopathy (BAG3-DCM), which is the most common form of cardiomyopathy and is characterized by progressive thinning of the walls of the heart resulting in enlarged heart chambers that are unable to pump blood.', 'Cranbury, NJ, United States', 299);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AEP', 'STOCK', 'American Electric Power Company, Inc.', 'NMS', 'Utilities', 'Utilities - Regulated Electric', 'American Electric Power Company, Inc. É uma empresa de holding de serviços públicos elétricos. Suas empresas operacionais de energia elétrica fornecem serviços de geração, transmissão e distribuição para mais de cinco milhões de clientes de varejo em Arkansas, Indiana, Kentucky, Louisiana, Michigan, EUA. Ohio, Oklahoma, Tennessee, Texas, Virgínia e Virgínia Ocidental. Seus segmentos incluem Utilidades verticalmente integradas, Utilitários de Transmissão e Distribuição, Transmissão AEP Holdco e Geração & Marketing. A Vertical Integrated Utilities está envolvida na geração, transmissão e distribuição de eletricidade para venda a clientes de varejo e atacado. Os Serviços de Transmissão e Distribuição consistem na transmissão e distribuição de eletricidade para venda a clientes de varejo e atacado. A AEP Transmission Holdco está envolvida no desenvolvimento, construção e operação de instalações de transmissão. O segmento de Geração e Marketing realiza atividades de Marketing, Gestão de Ris', 'Columbus, OH, United States', 16330);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CGNX', 'STOCK', 'Cognex Corporation', 'NMS', 'Technology', 'Scientific & Technical Instruments', 'A Cognex Corporation inventa e comercializa tecnologias que abordam vários desafios críticos de fabricação e distribuição. A empresa é uma fornecedora global de produtos e soluções de visão de máquina que melhoram a eficiência e a qualidade em empresas em todos os mercados finais industriais. Opera através do segmento de tecnologia de visão de máquina. Suas soluções combinam produtos físicos e software para capturar e analisar informações visuais, permitindo a automação de tarefas de fabricação e distribuição para clientes em todo o mundo. Os produtos de visão por máquina são usados para automatizar a fabricação ou distribuição e rastreamento de itens discretos, como telefones celulares, baterias de veículos elétricos e pacotes de comércio eletrônico, localizando, identificando, inspecionando e medindo-os. A visão por máquina é importante para aplicações em que a visão humana é inadequada para atender aos requisitos de tamanho, precisão ou velocidade, ou em casos em que economias subst', 'Natick, MA, United States', 2914);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CWH', 'STOCK', 'Camping World Holdings, Inc.', 'NYQ', 'Consumer Cyclical', 'Auto & Truck Dealerships', 'Camping World Holdings, Inc. is a retailer of recreational vehicles (RVs) and related products and services. The Company operates through two segments: Good Sam Services and Plans and RV and Outdoor Retail. Its Good Sam Services and Plans segment consists of programs, plans and services that are geared towards protecting, insuring and promoting the RV & travel lifestyles, and includes services such as extended vehicle service contracts, vehicle roadside assistance, property and casualty insurance, travel protection, travel planning and directories, and publications. Its RV and Outdoor Retail segment consists of all aspects of its RV dealership operations, which includes selling new and used RVs, assisting with the financing of new and used RVs, selling protection and insurance-related services and plans for RVs, servicing and repairing new and used RVs, installing RV parts and accessories, and selling RV and outdoor related products, parts and accessories.', 'Lincolnshire, IL, United States', 12701);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('GL', 'STOCK', 'Globe Life Inc.', 'NYQ', 'Financial Services', 'Insurance - Life', 'A Globe Life Inc. É uma companhia seguradora de seguros. Suas principais subsidiárias são a Globe Life and Accident Insurance Company, a American Insurance Company, a Liberty National Life Insurance Company, a Family Heritage Life Insurance Company of America e a United American Insurance Company. Os segmentos da Companhia incluem seguro de vida, seguro de saúde suplementar e investimentos. Os produtos de seguro de vida incluem seguro de vida inteira e de vida a termo tradicional. A empresa oferece suplemento Medicare e produtos de seguro de saúde suplementar de benefício limitado que incluem acidente, câncer, doença crítica, coração, cuidados intensivos, e outros produtos de saúde. Estes produtos são projetados para complementar a cobertura de saúde que os candidatos já possuem. Os suplementos Medicare são oferecidos a inscritos no tradicional programa Medicare de taxa por serviço. Os planos de Suplemento Medicare são padronizados por regulamentação federal e são projetados para pagar', 'McKinney, TX, United States', 3732);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BTSG', 'STOCK', 'BrightSpring Health Services, Inc.', 'NMS', 'Healthcare', 'Health Information Services', 'BrightSpring Health Services, Inc. provides home and community-based pharmacy and health solutions for populations in need of specialized and/or chronic care. Through the Companys service lines, including pharmacy, home health care and primary care, and rehabilitation and behavioral health, it provides integrated care and clinical solutions in all 50 states to over 450,000 customers, clients and patients daily. With a focus on senior and specialty patients, the Companys platform provides pharmacy and provider services (both clinical and supportive care in nature) in lower-cost home and community settings largely to medicare, medicaid, and commercially insured populations. It delivers services through two reportable segments: Pharmacy Solutions and Provider Services. It provides pharmacy services when and where demanded and as required by customers and patients in their homes and communities, often in coordination with its providers services.', 'Louisville, KY, United States', 37000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BLNE', 'STOCK', 'Beeline Holdings, Inc.', 'NCM', 'Consumer Defensive', 'Beverages - Wineries & Distilleries', 'Beeline Holdings, Inc. is a mortgage fintech transforming the way people access property financing. Through its fully digital, artificial intelligence-powered platform, it delivers a path to home loans-whether for primary residences or investment properties. The Company focuses on prop tech, mortgage, and alternative equity products. The Companys segments include Beeline Financial and Corporate. The Beeline Financial segment is a full-service direct-to-consumer lender specializing in conventional conforming and non-conforming residential first-lien mortgages and providing title services. Beeline Financial also has an emerging business in anonymized data sales and technology licensing.', 'Providence, RI, United States', 91);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ADI', 'STOCK', 'Analog Devices, Inc.', 'NMS', 'Technology', 'Semiconductors', 'Analog Devices, Inc. É uma empresa global de semicondutores. A empresa projeta, fabrica, testa e comercializa um portfólio de soluções, incluindo circuitos integrados (ICs), software e subsistemas que utilizam tecnologias de processamento de sinais analógicos, mistos e digitais de alto desempenho. Seu portfólio abrangente de produtos, especialização de domínio e capacidades de fabricação se estendem por tecnologias de processamento e gerenciamento de energia, precisão de alto desempenho e sinal misto de alta velocidade, incluindo conversores de dados, amplificadores, gerenciamento de energia, ICs de radiofrequência (RF), processadores de borda e outros sensores. O portfólio de produtos IC da empresa inclui tanto produtos de uso geral usados por uma variedade de clientes e aplicações, bem como produtos específicos para aplicativos projetados para mercados-alvo específicos. Seus ICs analógicos monitoram, condicionam, amplificam ou transformam sinais analógicos contínuos associados a prop', 'Wilmington, MA, United States', 24000);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('VTYX', 'STOCK', 'Ventyx Biosciences, Inc.', 'NMS', 'Healthcare', 'Biotechnology', 'Ventyx Biosciences, Inc. is a clinical-stage biopharmaceutical company. The Company is focused on developing oral therapies for patients with autoimmune, inflammatory, and neurodegenerative diseases. Its lead portfolio of NOD-like receptor protein 3 (NLRP3) inhibitors includes VTX2735, a peripherally restricted NLRP3 inhibitor in Phase II development for recurrent pericarditis, and VTX3232, a CNS-penetrant NLRP3 inhibitor in Phase II development for neurodegenerative and cardiometabolic diseases. Its inflammatory bowel disease portfolio includes tamuzimod (VTX002), an S1P1R modulator, and VTX958, a TYK2 inhibitor, both of which have completed Phase II clinical trials. Tamuzimod is a sphingosine 1 phosphate receptor (S1P1R) modulator in development for patients with moderately to severely active ulcerative colitis (UC). VTX958 is a selective allosteric tyrosine kinase type 2 (TYK2) inhibitor in Phase II development for the treatment of moderately to severely active Crohns disease.', 'San Diego, CA, United States', 81);\nINSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CRI', 'STOCK', 'Carter''s, Inc.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'Carter''s, Inc. É um comerciante de vestuário infantil na América do Norte. Seus segmentos incluem varejo dos EUA, atacado dos EUA e internacional. O segmento de varejo dos EUA inclui vendas de produtos nos Estados Unidos através de suas lojas de varejo e sites de comércio eletrônico. O segmento de atacado dos EUA consiste em vendas nos Estados Unidos de produtos para seus parceiros grossistas. O segmento internacional inclui vendas de produtos fora dos Estados Unidos, através de suas lojas de varejo e sites de comércio eletrônico no Canadá e México, e vendas para seus clientes e licenciados internacionais por atacado. Possui as marcas Carter''s e Oshkosh B''gosh. Essas marcas são vendidas em lojas de departamento, redes nacionais e varejistas especializados no mercado interno e internacional. Eles também são vendidos através de quase 1 000 lojas operadas pela empresa nos Estados Unidos, Canadá e México e on-line em www.carters.com, www.oshkosh.com, www.cartersoshkosh.ca e www.carters.', 'Atlanta, GA, United States', 15350);\n